(132, 16401, 'INDOMIE GORENG 85GR', 'Indomie goreng merupakan mie instan tanpa kuah, Setiap kemasan Mi Goreng berisi 2 bumbu sachet, yang terdiri dari bumbu dalam bentuk \"bubuk\" dan \"cair\". Sachet pertama terbagi menjadi 3 bagian yang terdiri dari: kecap manis, saus cabe dan minyak bumbu. Sachet kedua terbagi menjadi 2: bumbu dalam bentuk bubuk dan bawang goreng.', 1, 1, 1, 7, 1, NULL, 0, 2206, 2450, 2400, 2327.5, 'storage/app/image/xXK6Im9zcLzjRLIzFT9z6AGeyZFCEYjhMVoM8YiS.png', 'INDOMIE GRG 85GR  ', '2018-05-28 01:26:10', '2018-07-11 22:01:37', NULL),
