(138, 16513, 'KAPAL API SPC MIX 25GR', 'Kapal Api Special Mix Kopi adalah kopi special mix yang terbuat dari biji kopi pilihan dengan menggunakan teknologi canggih, sehinnga menghasilkan rasa & aroma kopi yang nikmat', 1, 1, 1, 2, 2, NULL, 0, 1004, 1200, 0, 1140, 'storage/app/image/Uxi1XrNMDa4wpWSBUdoXgUz1jC8FwbQtIP0gwfYb.png', 'KOPI KA SP MX 25GR', '2018-05-28 01:28:45', '2018-06-11 09:34:24', NULL),
(139, 16525, 'ENAAK SKM PUTIH 370GR', 'Susu Kental Manis Enaak  mengandung zat gizi makro (zat gizi penting: protein, karbohidrat dan lemak) dan zat gizi mikro (multi vitamin dan mineral) untuk melengkapi asupan gizi keluarga dan mendukung aktivitas keluarga sepanjang hari.', 1, 1, 1, 2, 1, NULL, 0, 7904, 8800, 0, 8360, 'storage/app/image/RvBk0wf7IxWswSQmlAYiN6DtoKElnqKI3EOEqzcZ.png', 'SUSU P ENAAK 370GR', '2018-05-28 01:29:11', '2018-07-11 22:05:20', NULL),
(140, 16504, 'WHITE COFEE LUWAK 20GR', 'LUWAK White Koffie merupakan white coffee yang terbuat dari kombinasi krimer non susu dan gula murni dengan kopi luwak pilihan, dihasilkan dari biji kopi terbaik. Luwak Coffee diolah melalui proses fermentasi, teknik perkebunan, dan teknik pemanggangan yang unik dengan teknologi paling modern sehingga menghasilkan cita rasa yang khas dan nikmat. Luwak White Koffie juga dihasilkan melalui proses pembekuan dalam suhu -40 derajat celcius yang dapat menghilangkan asam lambung dengan tetap mempertahankan kafein di dalamnya, sehingga aman untuk Anda yang menyukai kopi.', 1, 1, 1, 2, 5, NULL, 0, 9990, 1185, 1150, 1093, 'storage/app/image/YM28LTnoCJFg0HdpUHWsOsABD70uj1JwIEWZmDZb.png', 'WHT COFFE LWK 20GR', '2018-05-28 01:29:44', '2018-08-26 17:51:33', NULL),
